import React from "react";
import Login from '../Components/Login/Index';
import Employee from '../Components/EmployeeShift/Index';
import Home from '../Components/Home/Index';
const routes = [
    {
        path:"/",
        exact:true,
        main:()=><Login />
    },
    {
        path:"/employee",
        exact:true,
        main:()=><EmployeeShi />
    },
    {
        path:"/home",
        exact:true,
        main:()=><Home />
    }
];
export default routes;
